        [HttpGet("loginadservice")]

        [Authorize(AuthenticationSchemes = NegotiateDefaults.AuthenticationScheme)]
        public async Task<ActionResult<LoginUserResponse>> login()
        {

            
            
            
            string? username = HttpContext.User.Identity.Name;
            var userData = _httpContextAccessor.HttpContext.User;
            ActiveDirectoryService ac = new ActiveDirectoryService();
            var user = ac.GetUserFromAd(_configuration.GetSection("AppSettings:Domain").Value, username);

            if (user != null)
            {
               var cacheKey = $"LoginRequest::{user.UserName}";

                // Try to get the cached data
                if (!_cacheService.TryGetValue(cacheKey, out LoginUserResponse cachedData))
                {
                    var data = await _mediator.Send(new LoginUserRequest(user.UserName));
                    if (data != null)
                    {
                        // Store data in cache
                        _cacheService.Set(cacheKey, data, 180); // Adjust the cache duration as needed


                        return data;
                    }
                    else
                    {
                        var unauthorizedMessage = new { message = "Employee not found" };
                        return new UnauthorizedObjectResult(unauthorizedMessage);
                    }
                }

                // Return the cached data if available
                return cachedData;
            }
            else
            {
                var unauthorizedMessage = new { message = "Active Directory user not found" };
                return new UnauthorizedObjectResult(unauthorizedMessage);
            }

        
        }
