        [HttpPost("integration/userinfo")]
        [AllowAnonymous]
        public async Task<ActionResult<LoginUserResponse>> GetUserTasUserInfo(GetUserTasUserInfoRequest request)
        {
            LoginUserResponse loginUserCacheOutData = null;
            if (!_cacheService.TryGetValue($"Auth::{request.username}", out loginUserCacheOutData))
            {
                loginUserCacheOutData = await _authenticationRepository.LoginUserMiddleware(new LoginUserRequest(request.username));
                if (loginUserCacheOutData != null)
                {
                    _cacheService.Set($"Auth::{request.username}", loginUserCacheOutData, 180);
                    return loginUserCacheOutData;
                }
                else
                {
                    var unauthorizedMessage = new { message = "Employee not found" };
                    return Unauthorized(unauthorizedMessage);
                }
            }
            else
            {
                return loginUserCacheOutData;
            }

        }

